import React from "react";
import { Link } from "react-router-dom";

export default props => {
  return (
    <Link>
      <tr>
        <td>{props.date}</td>
        <td>{props.description}</td>
        <td>{props.category}</td>
        <td>${props.amount}</td>
      </tr>
    </Link>
  );
};
